CREATE MATERIALIZED VIEW stream_query AS SELECT hop_0.c3 AS col_0 FROM hop(alltypes2, alltypes2.c11, INTERVAL '86400', INTERVAL '6825600') AS hop_0 GROUP BY hop_0.c14, hop_0.c3, hop_0.c2 HAVING false;
DROP MATERIALIZED VIEW IF EXISTS stream_query;
